(function(){$(document).ready(function(){var form;form=$("#form-login");return form.submit(function(e){$.ajax({url:form.attr("action"),type:form.attr("method"),data:form.serialize(),success:function(data){var err,_i,_len,_ref,_results;$("#error-container").empty();$("#alert-danger").remove();if(data.redirect_to){return window.location.href=data.redirect_to}else if(data.needs_activate){return $("#seperator").after("<div class='alert alert-danger' id='alert-danger'> Must activate account </div>")}else if(data.errors){_ref=data.errors;_results=[];for(_i=0,_len=_ref.length;_i<_len;_i++){err=_ref[_i];_results.push($("#error-container").append("<ul class='parsley-errors-list filled' id='parsley-id-6054'> <li class='parsley-custom-error-message'>"+err+"</li> </ul>"))}return _results}}});return e.preventDefault()})})}).call(this);